val offerViewId = parquetFileOffer.select("offerViewId")
val offerId = parquetFileOffer.select(substring_index(parquetFileOffer("offerViewId"),"-",1))
val distinctOfferId = offerId.select("substring_index(offerViewId,-,1)").distinct()
val offers = distinctOfferId.select("substring_index(offerViewId,-,1)").rdd.map(r => r(0)).collect()
distinctOfferId.rdd.coalesce(1, false).saveAsTextFile("/tmp/sidana/distinctOffersPurch")
